  \"2014-06-25T19:38:33.158706\",\n\t\"name\": \"soil-survey-geographic-ssurgo-database-for-valencia-county-new-mexico-eastern-part\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"nThis data set is a digital soil survey
  and generally is the mostndetailed level of soil geographic data developed by the
  NationalnCooperative Soil Survey. The information was prepared by digitizingnmaps,
  by compiling information onto a planimetric correct basenand digitizing, or by revising
  digitized maps using remotelynsensed and other information.nnThis data set consists
  of georeferenced digital map data andncomputerized attribute data. The map data
  are in a soil survey areanextent format and include a detailed, field verified inventorynof
  soils and miscellaneous areas that normally occur in a repeatablenpattern on the
  landscape and that can be cartographically shown atnthe scale mapped. A special
  soil features layer (point and linenfeatures) is optional. This layer displays the
  location of featuresntoo small to delineate at the mapping scale, but they are largenenough
  and contrasting enough to significantly influence use andnmanagement. The soil map
  units are linked to attributes in thenNational Soil Information System relational
  database, which givesnthe proportionate extent of the component soils and their
  properties.n\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
